import React, { useState, useEffect } from "react";
import { useAuthStore } from "../store";
import { useNavigate } from "react-router-dom";
import { Dropdown } from "./ui/Layouts";
import toast from "react-hot-toast";

export default function Header({ onMenuClick }) {
  const { user, logout } = useAuthStore((s) => ({
    user: s.user,
    logout: s.logout,
  }));
  const navigate = useNavigate();
  const [marketStatus, setMarketStatus] = useState("CLOSED");
  const [currentTime, setCurrentTime] = useState(new Date());

  // Update market status
  useEffect(() => {
    const updateMarketStatus = () => {
      const now = new Date();
      const hours = now.getHours();
      const minutes = now.getMinutes();
      const dayOfWeek = now.getDay();

      const isWeekday = dayOfWeek > 0 && dayOfWeek < 6;
      const isMarketHours = (hours > 9 || (hours === 9 && minutes >= 15)) &&
                            (hours < 15 || (hours === 15 && minutes <= 30));

      if (isWeekday && isMarketHours) {
        setMarketStatus("OPEN");
      } else if (!isWeekday) {
        setMarketStatus("WEEKEND");
      } else {
        setMarketStatus("CLOSED");
      }

      setCurrentTime(now);
    };

    updateMarketStatus();
    const interval = setInterval(updateMarketStatus, 60000);
    return () => clearInterval(interval);
  }, []);

  const handleNavigate = (path) => {
    try {
      navigate(path);
    } catch (error) {
      console.error(`Navigation error to ${path}:`, error);
      toast.error("Failed to navigate");
    }
  };

  const handleLogout = async () => {
    try {
      logout();
      // Clear all user data
      localStorage.removeItem("access_token");
      localStorage.removeItem("refresh_token");
      localStorage.removeItem("user");
      sessionStorage.clear();

      toast.success("笨 Logged out successfully!");
      navigate("/login", { replace: true });
    } catch (error) {
      console.error("Logout error:", error);
      toast.error("Logout failed. Clearing data anyway.");
      // Still clear data and redirect even if logout fails
      localStorage.removeItem("access_token");
      localStorage.removeItem("refresh_token");
      localStorage.removeItem("user");
      navigate("/login", { replace: true });
    }
  };

  const getMarketStatusColor = () => {
